import ApexCharts from "apexcharts";
import ReactApexChart from "react-apexcharts";

function ChartBox() {
  const data = [
    {
      price: {
        time_close: "2018-04-18T19:16:00",
        open: 8615000,
        high: 8618000,
        low: 8611000,
        close: 8611000,
      },
    },
  ];
  return (
    <div>
      <ReactApexChart
        type="candlestick"
        options={{ chart: { type: "candlestick" } }}
        series={[
          {
            data: data?.map((price) => {
              return [
                Date.parse(price.time_close),
                price.open,
                price.high,
                price.low,
                price.close,
              ];
            }),
          },
        ]}
      />
    </div>
  );
}

export default ChartBox;
